import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    button: {
        backgroundColor:"#A370F7",
        padding: 15,
        borderRadius: 7,
        alignItems: "center",
        marginTop: 20
    },
    buttonText:{
        color: "#FFF",
        fontSize: 17,
        fontWeight: "bold"
    }
})

export default styles
